import logo from './logo.svg';
import './App.css';
import Menu from './menu';
import Footer from './Footer';
function App() {
  return (
    <div className="App">
      <main className="main-content">
        {/* Your main content */}
        <div id="target-div" className="target-div">
          <h2>This is the target div</h2>
          <p>Content inside the target div.</p>
        </div>
      </main>
      <section id="examples">
        <h2>Examples</h2>
        <menu>
          <Menu>About</Menu>
          <Menu>Contact</Menu>
          <Menu>Projects</Menu>
          <Menu>Achivements</Menu>
        </menu>
      </section>
    </div>
  );
}

export default App;
